<script>
export default {
  props:['level'],
  computed: {
    thisStageIsRoot() {
      const modeRotation = this.$store.getters.getWheelRotation.mode;
      if (modeRotation === 0) {
        return 'stage1';
      } else if (modeRotation === -90) {
        return 'stage6';
      } else if (modeRotation === -60) {
        return 'stage2';
      } else if (modeRotation === -120) {
        return 'stage3';
      } else if (modeRotation === 30) {
        return 'stage4';
      } else if (modeRotation === -30) {
        return 'stage5';
      } else if (modeRotation ===  -150) {
        return 'stage7';
      }
    }
  }
}
</script>

